        "summary": "Coffee-Infused Bbq Baby Back Ribs is a <b>gluten free and dairy free</b> recipe with 6 servings. This main course has <b>695 calories</b>, <b>41g of protein</b>, and <b>34g of fat</b> per serving. For <b>$2.47 per serving</b>, this recipe <b>covers 34%</b> of your daily requirements of vitamins and minerals. A couple people made this recipe, and 27 would say it hit the spot. If you have cider vinegar, oil, brown sugar, and a few other ingredients on hand, you can make it. It is brought to you by Foodista. From preparation to the plate, this recipe takes around <b>45 minutes</b>. Overall, this recipe earns a <b>solid spoonacular score of 79%</b>. Try <a href=\"https://spoonacular.com/recipes/coffee-infused-bbq-baby-back-ribs-1547521\">Coffee-Infused Bbq Baby Back Ribs</a>, <a href=\"https://spoonacular.com/recipes/keawe-grilled-baby-back-ribs-with-kona-coffee-bbq-grilling-and-dipping-sauce-746630\">Keawe Grilled Baby Back Ribs with Kona Coffee Bbq Grilling and Dipping Sauce</a>, and <a href=\"https://spoonacular.com/recipes/bbq-baby-back-ribs-268384\">BBQ Baby Back Ribs</a> for similar recipes.",
