        "summary": "Cottage pie with Quorn mince requires approximately <b>45 minutes</b> from start to finish. For <b>$3.45 per serving</b>, this recipe <b>covers 33%</b> of your daily requirements of vitamins and minerals. One portion of this dish contains approximately <b>32g of protein</b>, <b>28g of fat</b>, and a total of <b>629 calories</b>. This recipe serves 3. Head to the store and pick up canned tomatoes, cumin powder, parsley, and a few other things to make it today. 2 people found this recipe to be delicious and satisfying. It is brought to you by Foodista. With a spoonacular <b>score of 77%</b>, this dish is solid. <a href=\"https://spoonacular.com/recipes/cottage-pie-with-quorn-mince-1350599\">Cottage pie with Quorn mince</a>, <a href=\"https://spoonacular.com/recipes/little-mince-pie-cakes-217100\">Little mince pie cakes</a>, and <a href=\"https://spoonacular.com/recipes/mince-pie-cupcakes-1087695\">Mince Pie Cupcakes</a> are very similar to this recipe.",
