        "instructions": "<ol><li>For Burgers:</li><li>In a pan cook turkey bacon according to directions on package.</li><li>Once bacon is done being cooked, take the bacon out and set aside. Add bell pepper and onion into same pan, cook until tender about 10 minutes.</li><li>Add ground beef to a small bowl, add garlic powder and ground pepper, mix well.</li><li>Divide the raw meat into 8 equal pieces (I used my scale to measure into 2oz each piece). Flatten out the hamburger, and place 1/2 a cheese wedge onto each piece of hamburger. Take the other pieces of the hamburger and place on top of the cheese , and squish them togther and seal the edges so the cheese doesnt ozzz out. Place on grill and cook until done. About 5 minutes per side.</li><li>Place burger on buns, top the burgers with bacon, peppers & onions and sauce.</li><li>For Spicy Chipotle Aiolo Sauce:</li><li>In a small bowl place all the ingredients together and wisk together until combined.</li><li>Makes 3/4 cups or 12 Tablespoons</li></ol>",
