        "instructions": "<ol><li>Heat a nonstick sauce pan over medium flame.</li><li>Add cranberries, brown sugar and vanilla extract to the pan.</li><li>Mix, cover and cook for 4-5 minutes till the cranberries are soft and mash it with a spoon.</li><li>Turn off the flame and let it cool for a while.</li><li>In a mixing bowl combine all the dry ingredients.</li><li>In another bowl whip the eggs and mix in the milk.</li><li>Add the cranberries mix to the egg and milk. Beat thoroughly.</li><li>Pour the liquid ingredients to the dry ingredients and mix well. Let it stand for 2 minutes.</li><li>In the meantime heat the griddle or fry pan over medium flame and grease it with cooking spray or oil of your choice.</li><li> Pour a spoonful of the batter into the pan and shape it round.</li><li> Let it cook for 2 minutes or until golden brown. The pancake would rise a bit.</li><li> Flip to the other side and cook again for 2 minutes or until golden brown.</li><li> Repeat the same process for all the pancakes.</li><li> Drizzle sweetener of your choice and top it with cream if desired and serve warm.</li></ol>",
