        "summary": "Havarti and Asparagus Quiche takes about <b>45 minutes</b> from beginning to end. This recipe serves 8 and costs $1.05 per serving. One portion of this dish contains approximately <b>12g of protein</b>, <b>37g of fat</b>, and a total of <b>537 calories</b>. A mixture of sugar, water, butter, and a handful of other ingredients are all it takes to make this recipe so tasty. 3 people were impressed by this recipe. This recipe is typical of Mediterranean cuisine. It works well as a reasonably priced hor d'oeuvre. It is brought to you by Foodista. With a spoonacular <b>score of 29%</b>, this dish is rather bad. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/shaved-asparagus-salad-with-bacon-havarti-586984\">Shaved Asparagus Salad with Bacon & Havarti</a>, <a href=\"https://spoonacular.com/recipes/steamed-asparagus-and-mushrooms-with-danish-havarti-cheese-114871\">Steamed Asparagus and Mushrooms With Danish Havarti Cheese</a>, and <a href=\"https://spoonacular.com/recipes/quiche-aux-asperges-et-saumon-asparagus-salmon-quiche-85181\">Quiche Aux Asperges Et Saumon (Asparagus & Salmon Quiche)</a>.",
