        "instructions": "<ol><li>In the bowl of a food processor, combine flour, salt, and sugar.</li><li>Add butter and pulse until the mixture resembles the size of small peas.</li><li>Add the first 5 tablespoons of water, one at a time.</li><li>Check consistency - if the mixture holds together when pinched, the crust is perfect  dont add any more water.</li><li>If, however, the crust still crumbles apart and wont stay together when pinched, that means it wont stay together while rolling either; go ahead and add the last tablespoon of water one teaspoon at a time, rechecking the consistency between each teaspoon.</li><li>The exact amount of water you need will depend on the amount of humidity in the air and therefore in the flour.</li><li>Once finished, turn the dough out onto a piece of plastic wrap.</li><li>Form the dough into a disk, and refrigerate 30 minutes before rolling it out.</li><li>You want that flour to relax and the butter to be nice and cold  that will ensure you have a nice flaky crust.</li><li>Meanwhile, boil a pot of water large enough to fit the stalks of asparagus.</li><li>Trim the ends of your asparagus making sure they will fit nicely into your quiche pan, arranged like the spokes in a bicycle wheel with the ends touching in the middle.</li><li>Place in boiling water, and blanch for 2-3 minutes.</li><li>Remove from boiling water and place in an ice bath to stop the cooking and keep the color nice and vibrant green.</li><li>Set aside.</li><li>Preheat oven to 350 degrees.</li><li>On a lightly floured surface, roll the dough out into a circle a few inches larger than your quiche or pie pan.</li><li>Fold the dough back up over the rolling pin if needed, to gently lift the crust into the dish.</li><li>Once the dough is neatly into the pan, make sure it is smoothly tucked into the corners.</li><li>Trim excess crust from the edges leaving about a 1 border.</li><li>Fold the excess dough under itself, making sure not to fold it over the edge of the pan, to ensure a nice even border.</li><li>Crimp the dough between your fingers to make little pinches.</li><li>Poke a few fork holes in it to allow the steam to escape, this will prevent a soggy bottom crust.</li><li>Blind bake the crust for 5 minutes.</li><li>This will prevent all of the custard from getting absorbed into the crust making it soggy.</li><li>Remove crust from oven and sprinkle with Havarti with Dill cheese.  Set aside.</li><li>Increase oven temperature to 375 degrees.</li><li>In a large bowl, combine eggs, heavy cream, and milk and whisk thoroughly.  Pour egg mixture gently over the cheese mixture.</li><li>Place asparagus stalks, tips pointing outwards into a spoke pattern like on a bicycle wheel, making sure the ends come together in the middle.</li><li>Bake 40 minutes.</li><li>Check to make sure the crust isnt getting too brown.</li><li>If it is, loosely drape a piece of foil over the top, making sure you dont lay it on the actual custard mixture in the middle.</li><li>Bake 10-12 minutes longer.</li><li>To test doneness, slide a butter knife under the edge of one of the asparagus stalks.</li><li>The knife should come out clean.</li><li>It should be moist  after all the quiche is moist, but it should be free of egg mixture.</li><li>If not, put it back in the oven with your tent foil on top for 3-4 more minutes.</li></ol>",
