        "summary": "Vegan Stuffed Portobello Mushroom over Quinoa might be just the side dish you are searching for. This recipe serves 4. One serving contains <b>386 calories</b>, <b>17g of protein</b>, and <b>22g of fat</b>. For <b>$2.6 per serving</b>, this recipe <b>covers 18%</b> of your daily requirements of vitamins and minerals. 2 people have made this recipe and would make it again. Head to the store and pick up nutritional yeast, tomato, tofu, and a few other things to make it today. It is brought to you by Foodista. It is a good option if you're following a <b>gluten free and dairy free</b> diet. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. Overall, this recipe earns a <b>solid spoonacular score of 68%</b>. Similar recipes are <a href=\"https://spoonacular.com/recipes/vegan-stuffed-portobello-mushroom-over-quinoa-1376937\">Vegan Stuffed Portobello Mushroom over Quinoa</a>, <a href=\"https://spoonacular.com/recipes/stuffed-portobello-mushroom-271702\">Stuffed Portobello Mushroom</a>, and <a href=\"https://spoonacular.com/recipes/portobello-stuffed-mushroom-burger-441441\">Portobello Stuffed Mushroom Burger</a>.",
