        "summary": "Basil, Olive and Feta Foccacia takes around <b>45 minutes</b> from beginning to end. For <b>$1.1 per serving</b>, you get a side dish that serves 8. One portion of this dish contains around <b>12g of protein</b>, <b>13g of fat</b>, and a total of <b>341 calories</b>. If you have all purpose unbleached flour, feta, olives, and a few other ingredients on hand, you can make it. This recipe is liked by 3 foodies and cooks. It is a good option if you're following a <b>lacto ovo vegetarian</b> diet. It is brought to you by Foodista. Taking all factors into account, this recipe <b>earns a spoonacular score of 94%</b>, which is awesome. Try <a href=\"https://spoonacular.com/recipes/mango-and-feta-salad-with-black-olive-and-thai-basil-58742\">Mango And Feta Salad With Black Olive And Thai Basil</a>, <a href=\"https://spoonacular.com/recipes/sundried-tomato-olive-rosemary-and-thyme-foccacia-bread-662315\">Sundried Tomato,Olive,Rosemary and Thyme Foccacia Bread</a>, and <a href=\"https://spoonacular.com/recipes/lemon-and-basil-eggs-over-foccacia-301772\">Lemon and Basil Eggs over Foccacia</a> for similar recipes.",
        "cuisines": [],
