        "summary": "Classic Macaroni and Cheese might be a good recipe to expand your main course repertoire. This recipe serves 6 and costs $1.73 per serving. One serving contains <b>952 calories</b>, <b>35g of protein</b>, and <b>55g of fat</b>. 13 people were impressed by this recipe. A mixture of salt and pepper, butter, milk, and a handful of other ingredients are all it takes to make this recipe so yummy. From preparation to the plate, this recipe takes about <b>45 minutes</b>. It is brought to you by Foodista. A few people really liked this American dish. With a spoonacular <b>score of 69%</b>, this dish is solid. Similar recipes are <a href=\"https://spoonacular.com/recipes/classic-macaroni-and-cheese-278068\">Classic Macaroni and Cheese</a>, <a href=\"https://spoonacular.com/recipes/classic-macaroni-and-cheese-498930\">Classic Macaroni and Cheese</a>, and <a href=\"https://spoonacular.com/recipes/classic-macaroni-and-cheese-569543\">Classic Macaroni and Cheese</a>.",
