        "instructions": "<ol><li>Heat oil in a skillet, add the onion, green pepper, and garlic, and cook gently, stirring occasionally, for 5 minutes or until soft but not browned.</li><li>Add the tomatoes and chili and cook over medium heat for 5 minutes, or until most of the liquid has evaporated.</li><li>Stir in the chili powder and paprika and cook for 3 minutes, then add the refried beans, breaking them up with a fork. Add the measured water and cook, stirring occasionally, for 8-10 minutes, until the mixture thickens.</li><li>Spoon the beans into the middle of a baking dish, arrange the tortilla chips around the edge and sprinkle with cumin. Sprinkle the cheese over the beans and tortilla chips.</li><li>Bake at 400 degrees for 15-20 minutes, until the cheese has melted.</li><li>Sprinkle the paprika for garnish in a lattice pattern on top and serve immediately.</li></ol>",
