        "instructions": "<ol><li>Thaw frozen shrimp according to package directions if using frozen, and then peel, devein and rinse shrimp in a colander.</li><li>While shrimp are draining, fill a medium size saucepan with cold water and cook tortellini according to package directions.  Do NOT overcook your tortellini, no more than 2-3 mins once tortellini are added to boiling water.</li><li>Drain pasta and set aside.</li><li>Using the same saucepan combine diced tomatoes, crushed bullion, parsley and thyme and bring to a low simmer.</li><li>While tomatoes are simmering bring a large skillet to medium heat and add olive oil.  Heat olive oil and add minced garlic, cooking just until slightly opaque (approx. 1 min).  Add garlic and olive oil to tomatoes, stir.  Taking a fork crush tomatoes, breaking up the pieces until you have a chunky sauce.</li><li>Add cream to skillet that you used for garlic and bring to a low simmer.  Add tomato sauce, Parmesan cheese and salt and pepper to taste to cream and bring to slow simmer</li><li>Add cream to skillet that you used for garlic and bring to a slow simmer.</li><li>Add tomato sauce, Parmesan cheese and salt and pepper to taste to cream and bring back up to a slow simmer.</li><li>Reduce heat on cream sauce to low to keep warm and continue to stir occasionally.</li><li>At this point you can butterfly your shrimp, which helps to make the amount of shrimp seem more substantial, but this is not a necessary step.</li><li>To butterfly your shrimp, place on cutting board and with a very sharp knife, open up shrimp along the back but not cutting all the way through.</li><li>Add shrimp to cream sauce and cover, allowing shrimp to cook for approximately 4-5 minutes.</li><li>Add tortellini to pan coating  with cream sauce and seasoning if necessary with additional salt and pepper.  Remove from heat.</li><li>Plate and top with a sprinkle of shredded parmesan cheese.</li></ol>",
