        "instructions": "<ol><li>Prepare Sauce according to instructions and set aside.</li><li>Prepare Lasagna noodles according to package instructions be sure to salt the water. After drained, toss with olive oil to help prevent sticking</li><li>Cut Lasagna noodles to the required length to fit in the pan. Save the smaller pieces as you may need to piece them together while making the lasagna.</li><li>Set your containers out in a row in front of you. Coat the bottom of each pan with one large spoonful of sauce. Then begin to layer noodles, Spoonfulls of ricotta cheese that are sufficient to coat the noodles, several spoonfuls of sauce to make a layer over the ricotta, shredded mozzarella to cover the sauce then repeat starting with the noodles again. Should make 2-3 layers depending on depth of pan. End with layer of Mozzarella cheese and sprinkle the parmesan over the top.</li><li>Cover with the included top and label with a sharpie marker  name of dish, instructions for preparation and date of preparation. Use by date.</li></ol>",
