        "summary": "Pecan-Baked Ham could be just the <b>gluten free</b> recipe you've been looking for. This recipe makes 12 servings with <b>409 calories</b>, <b>36g of protein</b>, and <b>20g of fat</b> each. For <b>$3.43 per serving</b>, this recipe <b>covers 23%</b> of your daily requirements of vitamins and minerals. This recipe is liked by 2 foodies and cooks. It works well as a rather pricey main course. From preparation to the plate, this recipe takes around <b>45 minutes</b>. If you have pecans, brown sugar, butter, and a few other ingredients on hand, you can make it. It is brought to you by Foodista. With a spoonacular <b>score of 55%</b>, this dish is pretty good. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/baked-ham-with-brown-sugar-ham-glaze-1430187\">Baked Ham with Brown Sugar Ham Glaze</a>, <a href=\"https://spoonacular.com/recipes/baked-ham-with-brown-sugar-ham-glaze-551806\">Baked Ham with Brown Sugar Ham Glaze</a>, and <a href=\"https://spoonacular.com/recipes/maple-pecan-glazed-ham-418170\">Maple-Pecan Glazed Ham</a>.",
