        "summary": "Gluten Free Vegetarian Spring Rolls With Thai-Style Peanut Sauce takes around <b>45 minutes</b> from beginning to end. One portion of this dish contains approximately <b>3g of protein</b>, <b>6g of fat</b>, and a total of <b>91 calories</b>. This dairy free recipe serves 15 and costs <b>21 cents per serving</b>. Not a lot of people really liked this Vietnamese dish. It can be enjoyed any time, but it is especially good for <b>Spring</b>. It works well as a hor d'oeuvre. 5 people have tried and liked this recipe. Head to the store and pick up es round spring roll wrappers, lime juice, warm water, and a few other things to make it today. It is brought to you by Foodista. Taking all factors into account, this recipe <b>earns a spoonacular score of 55%</b>, which is pretty good. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/gluten-free-vegan-spring-rolls-with-spicy-peanut-sauce-1594783\">Gluten-Free Vegan Spring Rolls with Spicy Peanut Sauce</a>, <a href=\"https://spoonacular.com/recipes/thai-style-chicken-spring-rolls-249289\">Thai-Style Chicken Spring Rolls</a>, and <a href=\"https://spoonacular.com/recipes/vegetarian-spring-rolls-with-garlic-lime-sauce-664708\">Vegetarian Spring Rolls With Garlic Lime Sauce</a>.",
