        "summary": "If you want to add more <b>lacto ovo vegetarian</b> recipes to your recipe box, Spinach Coriander Chive Bread might be a recipe you should try. For <b>94 cents per serving</b>, this recipe <b>covers 31%</b> of your daily requirements of vitamins and minerals. This bread has <b>460 calories</b>, <b>19g of protein</b>, and <b>16g of fat</b> per serving. This recipe serves 4. It is brought to you by Foodista. A mixture of all purpose flour, sunflower oil, yeast, and a handful of other ingredients are all it takes to make this recipe so tasty. 3 people were impressed by this recipe. From preparation to the plate, this recipe takes around <b>45 minutes</b>. Taking all factors into account, this recipe <b>earns a spoonacular score of 88%</b>, which is excellent. <a href=\"https://spoonacular.com/recipes/chive-coriander-salmon-and-cabbage-738000\">Chive-Coriander Salmon and Cabbage</a>, <a href=\"https://spoonacular.com/recipes/coriander-spiced-new-potatoes-in-spinach-sauce-44168\">Coriander-Spiced New Potatoes in Spinach Sauce</a>, and <a href=\"https://spoonacular.com/recipes/coriander-bread-181347\">Coriander Bread</a> are very similar to this recipe.",
