        "summary": "You can never have too many hor d'oeuvre recipes, so give Bananan in brown sugar ice cream a try. One serving contains <b>343 calories</b>, <b>3g of protein</b>, and <b>17g of fat</b>. For <b>98 cents per serving</b>, this recipe <b>covers 9%</b> of your daily requirements of vitamins and minerals. This recipe serves 6. It is a good option if you're following a <b>gluten free, dairy free, lacto ovo vegetarian, and fodmap friendly</b> diet. A mixture of vanillan extract, lemon juice, full-fat cream, and a handful of other ingredients are all it takes to make this recipe so flavorful. 5 people were glad they tried this recipe. <b>Summer</b> will be even more special with this recipe. From preparation to the plate, this recipe takes around <b>45 minutes</b>. It is brought to you by Foodista. Taking all factors into account, this recipe <b>earns a spoonacular score of 42%</b>, which is pretty good. Similar recipes are <a href=\"https://spoonacular.com/recipes/banana-brown-sugar-ice-cream-49399\">Banana-brown Sugar Ice Cream</a>, <a href=\"https://spoonacular.com/recipes/spiced-banana-brown-sugar-ice-cream-527592\">Spiced Banana & Brown Sugar Ice Cream</a>, and <a href=\"https://spoonacular.com/recipes/brown-sugar-banana-ice-cream-with-brownie-chunks-579324\">Brown Sugar Bananan Ice Cream with Brownie Chunks</a>.",
