        "summary": "My Drunken Fish Fillet takes roughly <b>45 minutes</b> from beginning to end. For <b>$1.05 per serving</b>, you get a hor d'oeuvre that serves 2. One serving contains <b>249 calories</b>, <b>8g of protein</b>, and <b>8g of fat</b>. 3 people found this recipe to be flavorful and satisfying. It is a good option if you're following a <b>dairy free and pescatarian</b> diet. Head to the store and pick up oil, salt, rice wine, and a few other things to make it today. It is brought to you by Foodista. All things considered, we decided this recipe <b>deserves a spoonacular score of 33%</b>. This score is rather bad. Similar recipes are <a href=\"https://spoonacular.com/recipes/fish-fillet-with-rosemary-85849\">Fish Fillet with Rosemary</a>, <a href=\"https://spoonacular.com/recipes/fillet-of-fish-macadamia-378005\">Fillet of Fish Macadamia</a>, and <a href=\"https://spoonacular.com/recipes/fish-fillet-with-rosemary-1226589\">Fish Fillet with Rosemary</a>.",
