        "summary": "Chicken Farfalle with Low-Fat Alfredo Sauce might be a good recipe to expand your main course recipe box. One serving contains <b>674 calories</b>, <b>43g of protein</b>, and <b>9g of fat</b>. For <b>$1.98 per serving</b>, this recipe <b>covers 27%</b> of your daily requirements of vitamins and minerals. This recipe serves 4. This recipe from Foodista has 7 fans. It is an <b>affordable</b> recipe for fans of Mediterranean food. Head to the store and pick up flour, butter, skim milk, and a few other things to make it today. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. Taking all factors into account, this recipe <b>earns a spoonacular score of 88%</b>, which is spectacular. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/chicken-farfalle-with-low-fat-alfredo-sauce-1632341\">Chicken Farfalle with Low-Fat Alfredo Sauce</a>, <a href=\"https://spoonacular.com/recipes/low-fat-alfredo-sauce-624428\">Low Fat Alfredo Sauce</a>, and <a href=\"https://spoonacular.com/recipes/almost-low-fat-chicken-alfredo-bake-with-bite-574307\">Almost Low Fat Chicken Alfredo Bake with Bite</a>.",
