        "summary": "Pan Seared Lamb Loin With Chimichurri & Roasted Trio Squash Salad With Goat Cheese and Pinenuts is a <b>gluten free, dairy free, paleolithic, and primal</b> recipe with 4 servings. This main course has <b>492 calories</b>, <b>21g of protein</b>, and <b>43g of fat</b> per serving. For <b>$3.83 per serving</b>, this recipe <b>covers 21%</b> of your daily requirements of vitamins and minerals. From preparation to the plate, this recipe takes about <b>45 minutes</b>. 56 people have made this recipe and would make it again. It is a <b>rather pricey</b> recipe for fans of Latin American food. Head to the store and pick up cilantro, shallot, flat leaf parsley, and a few other things to make it today. It is brought to you by Foodista. Overall, this recipe earns a <b>tremendous spoonacular score of 85%</b>. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/pan-seared-loin-of-lamb-15793\">Pan-seared Loin Of Lamb</a>, <a href=\"https://spoonacular.com/recipes/pan-roasted-lamb-chops-with-honey-balsamic-figs-and-goat-cheese-573325\">Pan-Roasted Lamb Chops with Honey-Balsamic Figs and Goat Cheese</a>, and <a href=\"https://spoonacular.com/recipes/pan-seared-steaks-with-balsamic-red-onions-and-roasted-garlic-and-porcini-mushroom-goat-cheese-butter-1013640\">Pan Seared Steaks with Balsamic Red Onions and Roasted Garlic and Porcini Mushroom Goat Cheese Butter</a>.",
