        "summary": "Triple Chocolate Pumpkin Pie might be just the dessert you are searching for. This recipe serves 12 and costs $1.22 per serving. One portion of this dish contains approximately <b>6g of protein</b>, <b>23g of fat</b>, and a total of <b>415 calories</b>. 9 people have made this recipe and would make it again. Head to the store and pick up butter, ground, milk chocolate, and a few other things to make it today. It is brought to you by Foodista. It is perfect for <b>Thanksgiving</b>. From preparation to the plate, this recipe takes around <b>45 minutes</b>. Overall, this recipe earns a <b>rather bad spoonacular score of 37%</b>. Similar recipes include <a href=\"https://spoonacular.com/recipes/triple-chocolate-pumpkin-pie-24660\">Triple-chocolate Pumpkin Pie</a>, <a href=\"https://spoonacular.com/recipes/triple-chocolate-pumpkin-pie-247792\">Triple Chocolate Pumpkin Pie</a>, and <a href=\"https://spoonacular.com/recipes/triple-chocolate-pumpkin-pie-571283\">Triple Chocolate Pumpkin Pie</a>.",
