        "summary": "If you have roughly <b>45 minutes</b> to spend in the kitchen, Creamy Polenta with Egg, Arrabiata & Bacon might be an outstanding <b>gluten free</b> recipe to try. For <b>$2.88 per serving</b>, this recipe <b>covers 18%</b> of your daily requirements of vitamins and minerals. This recipe serves 4. One serving contains <b>667 calories</b>, <b>24g of protein</b>, and <b>48g of fat</b>. This recipe from Foodista requires polenta, cream cheese, goat cheese, and parsley. 103 people have tried and liked this recipe. It works well as a main course. All things considered, we decided this recipe <b>deserves a spoonacular score of 53%</b>. This score is solid. <a href=\"https://spoonacular.com/recipes/creamy-polenta-with-bacon-and-sage-147819\">Creamy Polenta with Bacon and Sage</a>, <a href=\"https://spoonacular.com/recipes/creamy-polenta-with-bacon-and-cranberries-310561\">Creamy Polenta with Bacon and Cranberries</a>, and <a href=\"https://spoonacular.com/recipes/poached-egg-over-creamy-polenta-551339\">Poached Egg over Creamy Polenta</a> are very similar to this recipe.",
