        "summary": "Dark Chocolate Walnut Biscotti is a dessert that serves 36. One portion of this dish contains approximately <b>3g of protein</b>, <b>5g of fat</b>, and a total of <b>108 calories</b>. For <b>16 cents per serving</b>, this recipe <b>covers 3%</b> of your daily requirements of vitamins and minerals. This recipe from Foodista requires flour, cocoa powder, semisweet chocolate chips, and butter. Not a lot of people made this recipe, and 5 would say it hit the spot. This recipe is typical of Mediterranean cuisine. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 16%</b>. This score is not so great. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/cranberry-dark-chocolate-biscotti-617191\">Cranberry Dark Chocolate Biscotti</a>, <a href=\"https://spoonacular.com/recipes/deep-dark-chocolate-biscotti-237148\">Deep Dark Chocolate Biscotti</a>, and <a href=\"https://spoonacular.com/recipes/dark-chocolate-almond-biscotti-574552\">Dark Chocolate Almond Biscotti</a>.",
