        "image": "https://spoonacular.com/recipeImages/648638-556x370.jpg",
        "imageType": "jpg",
        "summary": "The recipe Julia Child's Coq au Vin can be made <b>in around 45 minutes</b>. For <b>$3.93 per serving</b>, you get a main course that serves 6. One portion of this dish contains approximately <b>35g of protein</b>, <b>41g of fat</b>, and a total of <b>778 calories</b>. 32 people have made this recipe and would make it again. Head to the store and pick up pearl onions, chicken thighs and legs, red wine, and a few other things to make it today. It is a <b>pretty expensive</b> recipe for fans of Mediterranean food. It is brought to you by Foodista. It is a good option if you're following a <b>gluten free and primal</b> diet. Taking all factors into account, this recipe <b>earns a spoonacular score of 64%</b>, which is pretty good. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/julia-childs-coq-au-vin-474447\">Julia Child’s Coq au Vin</a>, <a href=\"https://spoonacular.com/recipes/coq-au-vin-and-the-julia-child-100-502107\">Coq au Vin and the Julia Child 100</a>, and <a href=\"https://spoonacular.com/recipes/from-julia-child-my-husbands-favorite-coq-au-vin-112270\">From Julia Child: &quot;My Husband's Favorite Coq Au Vin&quot;</a>.",
